  const handleChange = selectedModel => {
    setSelectedModel(selectedModel);
  };
  
  return (
    <div className="Menu">
      
        
        <Select
        value={selectedModel}
        options={myModel}
        onChange={handleChange}
        
        />
        <p>
          Info
        </p>
        <p>
          Dataset
        </p>
      
    </div>
  );
}

export default Menu;
